import React, { useState } from "react";
import ImagePreview from './ImagePreview.js';
import axios from "axios";

const MAX_IMAGE_SIZE_MB = 7;
const MAX_IMAGE_SIZE_BYTES = MAX_IMAGE_SIZE_MB * 1024 * 1024;
const MIN_IMAGE_WIDTH = 200;

const styles = {
  uploadContainer: {
    maxWidth: "600px",
    margin: "50px auto",
    backgroundColor: "rgba(255, 255, 255, 0.9)",
    borderRadius: "10px",
    padding: "20px",
    boxShadow: "0 2px 5px rgba(0, 0, 0, 0.2)",
  },
  h1: {
    textAlign: "center",
    marginBottom: "30px",
    color: "#333",
  },
  form: {
    marginBottom: "20px",
  },
  formGroup: {
    marginBottom: "20px",
  },
  formLabel: {
    display: "block",
    marginBottom: "5px",
    color: "#333",
  },
  formInput: {
    width: "100%",
    padding: "10px",
    fontSize: "16px",
    border: "1px solid #ccc",
    borderRadius: "5px",
  },
  uploadBtn: {
    backgroundColor: "#4CAF50",
    color: "#F0FFFF",
    padding: "10px 20px",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    width: "100%",
    fontSize: "16px",
  },
  previewItem: {
    margin: "10px",
    textAlign: "center",
  },
};

const UploadPhotos = () => {
  const [selectedFiles, setSelectedFiles] = useState([]);
  const [userName, setUserName] = useState("");
  const [userEmail, setUserEmail] = useState("");

  const handleFileSelect = (event) => {
    const files = event.target.files;
    const newSelectedFiles = [];
    for (const file of files) {
      if (!selectedFiles.some((selectedFile) => selectedFile.name === file.name)) {
        newSelectedFiles.push(file);
        if (file.type === "image/png" || file.type === "image/jpeg" || file.type === "image/jpg") {
          if (file.size <= MAX_IMAGE_SIZE_BYTES) {
            // Image width validation
            const img = new Image();
            img.src = URL.createObjectURL(file);
            img.onload = function () {
              if (img.width >= MIN_IMAGE_WIDTH) {
                setSelectedFiles((prevSelectedFiles) => [...prevSelectedFiles, file]);
              } else {
                alert(
                  `Image '${file.name}' must have a width of at least ${MIN_IMAGE_WIDTH} pixels.`
                );
              }
            };
          } else {
            alert(
              "Image '" + file.name + "' is too large. Max size allowed: " + MAX_IMAGE_SIZE_MB + " MB."
            );
          }
        } else {
          alert(
            "Image '" +
              file.name +
              "' has an unsupported file type. Only PNG, JPEG, and JPG are allowed."
          );
        }
      } else {
        alert("Image '" + file.name + "' is already selected and will not be uploaded again.");
      }
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    // Prepare the data to send to the backend
    const formData = new FormData();
    //formData.append("userName", userName);
    //formData.append("userEmail", userEmail);
    selectedFiles.forEach((file) => {
      formData.append("photos", file);
    });


    try {
      // Make a POST request to the backend server to upload files
      await axios.post("http://localhost:3000/upload", formData);

      // Reset the form after successful upload
      setSelectedFiles([]);
      //setUserName("");
      //setUserEmail("");
    } catch (error) {
      console.error("Error uploading files:", error);
      // Handle any error that occurred during the upload
    }
  };


  return (
    <div style={styles.uploadContainer}>
      <h1 style={styles.h1}>Upload Photos</h1>
      <form style={styles.form} onSubmit={handleSubmit}>
        <div style={styles.formGroup}>
          <label style={styles.formLabel}>Name:</label>
          <input
            style={styles.formInput}
            type="text"
            value={userName}
            onChange={(e) => setUserName(e.target.value)}
          />
        </div>
        <div style={styles.formGroup}>
          <label style={styles.formLabel}>Email:</label>
          <input
            style={styles.formInput}
            type="email"
            value={userEmail}
            onChange={(e) => setUserEmail(e.target.value)}
          />
        </div>
        <div style={styles.formGroup}>
          <label style={styles.formLabel}>Select Photos:</label>
          <input
            style={styles.formInput}
            type="file"
            accept="image/png, image/jpeg, image/jpg"
            multiple
            onChange={handleFileSelect}
          />
        </div>
        <button style={styles.uploadBtn} type="submit">
          Upload
        </button>
      </form>
      <ImagePreview selectedFiles={selectedFiles} />
    </div>
  );
};

export default UploadPhotos;
